// TransactionSuccessPage.jsx

import React from 'react';
import { useParams } from 'react-router-dom';

function TransactionSuccessPage() {
    // Retrieve transactionDetails from location state
    const { state } = window.history;
    const transactionDetails = useParams();

    // Check if transactionDetails is defined before accessing its properties
    const transactionId = transactionDetails?.transactionId || 'N/A';
    const date = transactionDetails?.date || 'N/A';
    const time = transactionDetails?.time || 'N/A';
    const senderUserId = transactionDetails?.details?.senderUserId || 'N/A';
    const receiverTransactionId = transactionDetails?.details?.receiverTransactionId || 'N/A';
    const amount = transactionDetails?.details?.amount || 'N/A';
    const reason = transactionDetails?.details?.reason || 'N/A';

    return (
        <div>
            <h2>Transaction Successful</h2>
            <p>Transaction ID: {transactionId}</p>
            <p>Date: {date}</p>
            <p>Time: {time}</p>
            <p>Sender's User ID: {senderUserId}</p>
            <p>Receiver's Transaction ID: {receiverTransactionId}</p>
            <p>Amount: {amount}</p>
            <p>Reason: {reason}</p>
            <p>Thank you for transferring!</p>
        </div>
    );
}

export default TransactionSuccessPage;
